package Test.Message.Reduced;
option java_package = "com.trivago.message.test";
option go_package = "message";
option java_outer_classname = "AllDataReducedProto";

// Subset of first values of AllData for testing
// reading and preserving unknown fields
message ReducedData {
	optional double   double_value          = 1;
	optional float    float_value           = 2;
	optional int64    int_64_value          = 3;
}



